            MoveNext();
            if (_currentToken != SMLToken::AlphaLiteral &&
                _currentToken != SMLToken::AlphaExt3Literal)
                return false;

            // Key token already matched
            languageName = str();

            // Check end of content
            MoveNext();
            if (_currentToken != SMLToken::CloseParenthesis)
                return false;

            // Move beyond
            MoveNext();
