                key = GetString();

                // Verify match assign
                MoveNext();
                if (_currentToken != SMLToken::Colon)
                    return false;

                // Parse the value
                MoveNext();
                std::optional<SMLValue> internalValue;
                if (!TryParseValue(internalValue))
                    return false;

                // The value is required here
